import React, {Component} from "react";
import {MDBContainer, MDBCol,MDBRow} from "mdbreact";


const gridcode ={
    position:"absolute",
    width:"100vw",
    top:"57%",
    backgroundColor:"black",

}
const columncss ={
    padding:"20px",
    border: "2px solid white",
    zIndex:"900",
    backgroundColor:"white",
    margin:"10px",

}
const imagesizer ={
    width:"150px",
    height:"200px"
}

class GridBlock extends Component{


    render(){
        return(
            <MDBContainer fluid style={gridcode}>
                <MDBRow center>
                    <MDBCol size="10" style={columncss}> 
                    <img style={imagesizer} src={"https://images.unsplash.com/photo-1594954825820-e9ebfd9d0e21?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60"} alt="not visible" />
                    </MDBCol>
                </MDBRow>
            </MDBContainer>
        );
    }
}
export  default GridBlock;
